import React from 'react';
import logo from './logo.svg';
import './App.css';

function ContactUs() {
  return (
    <div>
      <input type="text" placeholder="Name" />
<br />
      <input type="text" placeholder="Email" />
<br />
      <input type="text" placeholder="Message" />
      </div>
  )
}

function App() {
  return (
    <div className="App">
      <h1>Pandan Cake!</h1>
      <div>
        <ContactUs />
      </div>
    </div>
  );
}

export default App;
